import { useForm } from 'react-hook-form';
import { apiRegister } from '../api/Api';


function registrationHandler(data) {
  let successRegistration = apiRegister(data["username"], data["password"]);
  if (successRegistration !== 1) {
    alert("Registration was not successfull");
  } else {
    window.location.href = "/login";
  }
}

function Signup(props) {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  return (
    <table style={{'tableLayout': 'fixed', 'width': '100%', 'height': '100%'}}>
      <tbody>
        <tr style={{"height": "33%"}}>
          <td style={{"width": "33%"}}></td>
          <td style={{"width": "33%"}}></td>
          <td style={{"width": "33%"}}></td>
        </tr>
        <tr style={{"height": "33%"}}>
          <td style={{"width": "33%"}}></td>
          <td style={{"width": "33%"}}>
            <form onSubmit={handleSubmit(registrationHandler)}>
              <div>
                  <label>Username</label>
                  <input {...register('username', { required: true })} />
                  {errors.username && <p>Username is required.</p>}
              </div>
              <div>
                  <label>Password</label>
                  <input type="password" {...register('password', { pattern: /.......*/ })} />
                  {errors.password && <p>Password must be at least 6 symbols long.</p>}
              </div>
              <div>
                  <label>Full name (3 words)</label>
                  <input {...register('fullname', { pattern: /.* .* .*/ })} />
                  {errors.fullname && <p>Full name must consist of 3 words separated by space.</p>}
              </div>
              <div>
                  <label>Email</label>
                  <input {...register('email', { pattern: /.*@.*..*/ })} />
                  {errors.email && <p>Email format is wrong.</p>}
              </div>
              <div>
                  <label>Phone</label>
                  <input {...register('phone', { pattern: /[0-9]*/, minLength: 11, maxLength: 11 })} />
                  {errors.password && <p>Phone must be in a form of 11 numbers only.</p>}
              </div>
              <button>Sign Up</button>
            </form>
          </td>
          <td style={{"width": "33%"}}></td>
        </tr>
        <tr style={{"height": "33%"}}>
          <td style={{"width": "33%"}}></td>
          <td style={{"width": "33%"}}></td>
          <td style={{"width": "33%"}}></td>
        </tr>
      </tbody>
    </table>
  );
}

export default Signup;
